import React from 'react';
import styles from './MainPage.module.css';

const MainPage = () => {
    return (
        <div className={styles.logo-container}>
            <img src={logo} alt="DTU Logo" className={styles.logo} />
                <div className={styles.nav-lines}>
                    <div className={styles.nav-line} data-page="Home">Home</div>
                    <div className={styles.nav-line} data-page="About">About</div>
                    <div className={styles.nav-line} data-page="Services">Services</div>
                    <div className={styles.nav-line} data-page="Contact">Contact</div>
                </div>
        </div>
    )
}

export default MainPage
